import React, { Component } from 'react';
import Footer from './Footer';
import Header from './Header'

class Layout extends Component {
    render() {
        return (
            <>
            <div></div>
                <Header/>  
                <div className="container">

                </div>
                <Footer/>
            </>


        );
    }
}

export default Layout;
